import React, { useState } from "react";

const DUMMY_DATA = [
  { id: 1, question: "What is AI?", answer: "AI is artificial intelligence." },
  { id: 2, question: "What is Machine Learning?", answer: "Machine Learning is a subset of AI." },
];

const CHAPTERS = [
  { id: 1, title: "Chapter 1: Introduction to AI" },
  { id: 2, title: "Chapter 2: Basics of Machine Learning" },
  { id: 3, title: "Chapter 3: Deep Learning Fundamentals" },
  { id: 4, title: "Chapter 4: Applications of AI" },
];

const TRANSCRIPTS = [
  "AI refers to the simulation of human intelligence in machines.",
  "Machine Learning is a subset of AI that allows machines to learn from data.",
  "Deep Learning is a specialized form of Machine Learning involving neural networks.",
  "Applications of AI include healthcare, finance, autonomous vehicles, and more.",
];

function Flashcards() {
  const [currentCard, setCurrentCard] = useState(0);
  const [showAnswer, setShowAnswer] = useState(false);

  const handlePrev = () => {
    setShowAnswer(false); // Reset the answer view
    setCurrentCard((currentCard - 1 + DUMMY_DATA.length) % DUMMY_DATA.length);
  };

  const handleNext = () => {
    setShowAnswer(false); // Reset the answer view
    setCurrentCard((currentCard + 1) % DUMMY_DATA.length);
  };

  const Flashcard = ({ content, onClick, showAnswer }) => (
    <div style={styles.flashcard} onClick={onClick}>
      {showAnswer ? content.answer : content.question}
    </div>
  );

  return (
    <div style={styles.container}>
      <div style={styles.sidebar}>
        <h2>Chapters</h2>
        <div style={styles.scrollable}>
          {CHAPTERS.map((chapter) => (
            <div key={chapter.id} style={styles.chapterItem}>
              {chapter.title}
            </div>
          ))}
        </div>
      </div>
      <div style={styles.content}>
        <Flashcard
          content={DUMMY_DATA[currentCard]}
          onClick={() => setShowAnswer(!showAnswer)}
          showAnswer={showAnswer}
        />
        <div style={styles.controls}>
          <button style={styles.button} onClick={handlePrev}>
            ← Previous
          </button>
          <button style={styles.button} onClick={handleNext}>
            Next →
          </button>
        </div>
        <div style={styles.transcript}>
          <h3>Transcript</h3>
          <div style={styles.scrollable}>
            {TRANSCRIPTS.map((text, index) => (
              <p key={index}>{text}</p>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
}

const styles = {
  container: {
    display: "flex",
    gap: "2rem",
    padding: "2rem",
    backgroundColor: "#f4f4f9",
    minHeight: "100vh",
  },
  sidebar: {
    flex: "0 0 20%",
    backgroundColor: "#ffffff",
    padding: "1rem",
    borderRadius: "8px",
    boxShadow: "0px 4px 6px rgba(0, 0, 0, 0.1)",
  },
  scrollable: {
    maxHeight: "200px",
    overflowY: "auto",
    paddingRight: "1rem",
  },
  chapterItem: {
    marginBottom: "0.5rem",
    padding: "0.5rem",
    backgroundColor: "#f0f0f0",
    borderRadius: "4px",
    cursor: "pointer",
    transition: "background-color 0.2s",
  },
  content: {
    flex: "1",
    textAlign: "center",
  },
  flashcard: {
    padding: "2rem",
    margin: "1rem auto",
    width: "90%",
    maxWidth: "400px",
    backgroundColor: "#ffffff",
    color: "#333",
    borderRadius: "12px",
    boxShadow: "0px 4px 6px rgba(0, 0, 0, 0.1)",
    fontSize: "1.2rem",
    textAlign: "center",
    cursor: "pointer",
    transition: "transform 0.2s",
  },
  controls: {
    marginTop: "1rem",
    display: "flex",
    justifyContent: "center",
    gap: "1rem",
  },
  button: {
    padding: "0.8rem 1.5rem",
    backgroundColor: "#6200ea",
    color: "#ffffff",
    border: "none",
    borderRadius: "8px",
    fontSize: "1rem",
    cursor: "pointer",
    transition: "background-color 0.2s",
  },
  transcript: {
    marginTop: "2rem",
    backgroundColor: "#ffffff",
    padding: "1rem",
    borderRadius: "8px",
    boxShadow: "0px 4px 6px rgba(0, 0, 0, 0.1)",
  },
};

export default Flashcards;
